import React, { Component } from "react";

class Profile extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userData: null,
      error: null,
      loading: true,
    };
  }

  componentDidMount() {
    this.fetchData();
  }

  fetchData = async () => {
    const token = localStorage.getItem("accessToken");
    try {
      const response = await fetch("http://195.210.47.82:8000/auth/me/", {
        headers: {
          // Добавьте необходимые заголовки, если они требуются (например, авторизация)
          Authorization: `Bearer ${token}`,
          "Content-Type": "application/json",
        },
      });

      if (!response.ok) {
        throw new Error("Network response was not ok");
      }

      const data = await response.json();
      this.setState({ userData: data, loading: false });
    } catch (error) {
      this.setState({ error: error.message, loading: false });
    }
  };

  render() {
    const { userData, error, loading } = this.state;

    if (loading) {
      return <div>Loading...</div>;
    }

    if (error) {
      return <div>Error: {error}</div>;
    }
    const info = JSON.stringify(userData, null, 2);
    console.log(info);
    return (
      <div>
        <h2>My profile</h2>
        <pre>{}</pre>
      </div>
    );
  }
}

export default Profile;
